Ko Te Uhi a Mataroa he ohu ā-motu o ngā kaitoi tā moko i whakatūria ai i te tau 2000 ki te tohu me te whakawhanake i te tā moko hei momo toi ora. Tokomaha ēnei kaitoi tautōhito he whakairo tā rātou mahi i mua, ko ētahi atu he mātanga hoahoa. Kei te tiritiri rātou i te mōhio hōhonu ki ngā āhua me ngā hoahoa taketake. Kua whakawhanaketia e Te Uhi he kaupapa pakari mō tēnei mahi, te tā moko. Kei te whakarato tēnei kaupapa i ngā paenga me ngā aratohu: te whakaute ki ngā tikanga me ngā mahi tuku iho;
..........
aronganui; te whakarite kia noho hauora, haumaru te kaiwhiwhi moko. He mahi mō roto i ngā hapori Māori te tā moko, ā, ko tā Te Uhi he whakapakari i te mātau ki tēnei momo toi i roto i ngā hapū me ngā iwi. He kaha hoki te aro mai o te ahumahi tā moko o tāwāhi ki ngā hoahoa tā moko o konei. Kei te ū a Te Uhi ki te tiaki i te mana whakairo hinengaro o te tā moko, ki te whakarite kia mahia te mahi nei i runga anō i te pono. Tuatahi, he kaha a Te Uhi ki te mau ki ngā tikanga o mua. Tuarua, ka titiro

9 no NOVEMA TE HAAMO’ARAAHIA O TE ARIIHIERO I LATERANA Oro’a Ia tano teie oroa i te dominika, e ravehia te mau taioraa i faataahia no te dominika TAIORAA MATAMUA E tia ia maite hoe taioraa i roto i na taioraa e piti i raro nei : 1. « Ua ite au i te pape ora i te hîraa mai no roto mai i te hiero e te feia atoa i ti’a’ia i taua pape ra, e ora ïa » A taio tatou i te puta a Ezekiela peropheta 47, 1-2.8-9.12 I taua mau mahana ra, ua ite i ta’u orama, e ua faahoi mai oia ia’u i te uputa o te fare ra ;
..........
aua nao ra. - O te Parau ïa a te Atua. SALAMO 45, 2-3, 5-6, 8-9a.10a R/ E anavai rahi ! Na tana mau amaa e faaoâoâ i te oire o te Atua, nana e haamo’a i te mau fare o te Teitei-Rahi ra. O te Atua, to tatou haapuraa, to tatou puai e to tatou hoi tauturu i pupuhia mai i roto i te ahoahoraa. No reira, eita roa matou e mataû ia faahuru è hia te fenua, ia arori noa ra te mau moua i rotopu i te moana. E anavai rahi ! Na tana mau amaa e faaoâoâ i te oire o te Atua, nana e haamo’a i te mau fare o te Tei
